import React from 'react';
import Slider from 'react-slick';

const settings = {
  dots: true,
  infinite: true,
  speed: 500,
  slidesToShow: 1,
  slidesToScroll: 1,
  autoplay: true,
};
export default function Carrousel() {
  return (
    <>
      <Slider {...settings}>
        <div>
          <div className="image-container">
            <img src="/carrousel/carrousel-item-1.jpg" alt="" />
          </div>
        </div>
        <div>
          <div className="image-container">
            <img src="/carrousel/carrousel-item-2.jpg" alt="" />
          </div>
        </div>
      </Slider>
      <style jsx>
        {`
        .image-container {
          max-width: 90vw;
        }
        .image-container img {
          width: 100%;
        }
        Slider{
          display: flex;
          justify-content: center;
        }
        `}
      </style>
    </>
  );
}
